// LayoutCliente.js
import React from 'react';
import { Outlet, Link } from 'react-router-dom';

function LayoutCliente() {
  return (
    <div>
      <nav className="menu-cliente">
        <div className="contenido-cliente">
          <div className="logo">
            <h2>S´ FOR YOUR NUTRITION</h2>
          </div>
          <ul className="menu-links">
            <li><Link to="/pages/productos">Productos</Link></li>
            <li><Link to="/pages/comprar">Ordenar</Link></li>
            <li><Link to="/pages/carrito">Carrito</Link></li>
            <li><Link to="/pages/mi-cuenta">Mi Cuenta</Link></li>
          </ul>
        </div>
      </nav>

      <div className="contenido-principal">
        <Outlet /> {/* Aquí se mostrarán las páginas hijas */}
      </div>
    </div>
  );
}

export default LayoutCliente;
